  "text" : "\uAD73\uC774 \uACF5\uC801 \uC601\uC5ED\uC5D0\uC11C \uAC1C\uC778\uC744 \uACA8\uB0E5\uD574\uC11C \uB2E4\uB8F0 \uB0B4\uC6A9\uC77C\uAE4C\uC694. \uBCF4\uC218\uC801 \uC724\uB9AC\uC5D0 (\uC2EC\uC815\uC801\uC73C\uB85C\uB294 \uB3D9\uC870\uD558\uC9C0\uB9CC) \uADF8\uB2E4\uC9C0 \uB3D9\uC758\uD558\uC9C0 \uC54A\uACE0, \uC774\uAC74\uD76C \uAC1C\uC778\uC758 \uC874\uC5C4\uC740 \uCC28\uCE58\uD558\uB354\uB77C\uB3C4, \uC8FC\uBCC0\uC778\uB4E4\uC758 \uC874\uC5C4 \uB610\uD55C \uBB38\uC81C\uACA0\uC8E0. \uBE44\uB85D \uADF8\uB4E4\uC774 \uC808\uB300\uC801\uC778 \uAC15\uC790\uB77C\uACE0 \uD574\uB3C4.",
